import fetch from "node-fetch";
import fs from "fs";
import { Storage } from '@google-cloud/storage';

const isValidUrl = (url) => {
  try {
    new URL(url);
    return true;
  } catch (error) {
    return false;
  }
}

const readImageFilePath = async(imageFilePath) => {
  const isUrl = isValidUrl(imageFilePath);

  if(isUrl) {
    const response = await fetch(imageFilePath);
    const imageFileBuffer = await response.buffer();

    return imageFileBuffer;
  }

  const storage = new Storage();
  const bucketName = process.env.BUCKET;
  const bucket = storage.bucket(bucketName);
  const imageFile = bucket.file(imageFilePath);

  const imageFileData = await imageFile.download();

  return imageFileData[0]; // buffer data
}

export default async ({accessToken, imageFilePath}: NodeInputs,{logging}: NodeScriptOptions) : NodeOutput  => {
    const imageFileData = await readImageFilePath(imageFilePath);

	const response = await fetch(
		"https://api-inference.huggingface.co/models/Salesforce/blip-image-captioning-large",
		{
			headers: { Authorization: `Bearer ${accessToken}` },
			method: "POST",
			body: imageFileData,
		}
	);

    const result = await response.json();

    return result;
}

import fetch from "node-fetch";
import { Storage } from '@google-cloud/storage';

export default async ({accessToken, text, audioFileName}: NodeInputs,{logging}: NodeScriptOptions) : NodeOutput  => {
	const response = await fetch(
		"https://api-inference.huggingface.co/models/facebook/musicgen-small",
		{
			headers: { Authorization: `Bearer ${accessToken}` },
			method: "POST",
			body: JSON.stringify({inputs: text}),
		}
	);

   // initialise storage configs
   const storage = new Storage();
   const bucketName = process.env.BUCKET;
   const bucket = storage.bucket(bucketName);
   const filePath = `hugging-face-text-to-audio/${audioFileName}`;
   const file = bucket.file(filePath);

   const fileStream = file.createWriteStream({ resumable: false });

   response.body.pipe(fileStream);

   await new Promise((resolve, reject) => {
     fileStream.on("finish", resolve);
     fileStream.on("error", reject);
   })

   // upload generated audio to cloud storage
   await file.makePublic();
   const downloadUrl = `https://storage.googleapis.com/${bucketName}/${filePath}`;

   return { downloadUrl };
}

